import React, { useState, useEffect } from 'react';
import { Search, User, Calendar, Heart, Filter, BarChart3, Grid } from 'lucide-react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';

const FHIRQuerySystem = () => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [viewType, setViewType] = useState('table');
  const [filters, setFilters] = useState({
    minAge: '',
    maxAge: '',
    condition: ''
  });

  // Sample FHIR data simulation
  const samplePatients = [
    { id: 1, name: 'John Doe', age: 65, condition: 'Diabetes', diagnosis_code: 'E11.9', last_visit: '2024-01-15' },
    { id: 2, name: 'Jane Smith', age: 52, condition: 'Diabetes', diagnosis_code: 'E11.9', last_visit: '2024-02-20' },
    { id: 3, name: 'Bob Johnson', age: 78, condition: 'Hypertension', diagnosis_code: 'I10', last_visit: '2024-01-10' },
    { id: 4, name: 'Alice Brown', age: 45, condition: 'Diabetes', diagnosis_code: 'E11.9', last_visit: '2024-03-05' },
    { id: 5, name: 'Charlie Wilson', age: 60, condition: 'Heart Disease', diagnosis_code: 'I25.9', last_visit: '2024-02-28' },
    { id: 6, name: 'Diana Davis', age: 55, condition: 'Diabetes', diagnosis_code: 'E11.9', last_visit: '2024-01-30' },
    { id: 7, name: 'Eve Martinez', age: 42, condition: 'Hypertension', diagnosis_code: 'I10', last_visit: '2024-03-10' },
    { id: 8, name: 'Frank Garcia', age: 68, condition: 'Heart Disease', diagnosis_code: 'I25.9', last_visit: '2024-02-15' }
  ];

  const querySuggestions = [
    "Show me all diabetic patients over 50",
    "Find patients with hypertension under 60",
    "List all patients with heart disease",
    "Show diabetic patients between 40 and 70",
    "Find all patients over 65 with any condition"
  ];

  // Simple NLP-like query processing
  const processQuery = (queryText) => {
    const lowerQuery = queryText.toLowerCase();
    let filteredResults = [...samplePatients];

    // Extract condition
    if (lowerQuery.includes('diabetic') || lowerQuery.includes('diabetes')) {
      filteredResults = filteredResults.filter(p => p.condition.toLowerCase().includes('diabetes'));
    } else if (lowerQuery.includes('hypertension') || lowerQuery.includes('blood pressure')) {
      filteredResults = filteredResults.filter(p => p.condition.toLowerCase().includes('hypertension'));
    } else if (lowerQuery.includes('heart')) {
      filteredResults = filteredResults.filter(p => p.condition.toLowerCase().includes('heart'));
    }

    // Extract age constraints
    const ageMatches = lowerQuery.match(/(\d+)/g);
    if (ageMatches) {
      const ages = ageMatches.map(Number);

      if (lowerQuery.includes('over') || lowerQuery.includes('above')) {
        const minAge = Math.min(...ages);
        filteredResults = filteredResults.filter(p => p.age > minAge);
      } else if (lowerQuery.includes('under') || lowerQuery.includes('below')) {
        const maxAge = Math.max(...ages);
        filteredResults = filteredResults.filter(p => p.age < maxAge);
      } else if (lowerQuery.includes('between')) {
        const minAge = Math.min(...ages);
        const maxAge = Math.max(...ages);
        filteredResults = filteredResults.filter(p => p.age >= minAge && p.age <= maxAge);
      }
    }

    return filteredResults;
  };

  const handleSearch = async () => {
    if (!query.trim()) return;

    setLoading(true);

    // Simulate API delay
    await new Promise(resolve => setTimeout(resolve, 1000));

    const processedResults = processQuery(query);
    setResults(processedResults);
    setLoading(false);
  };

  const applyFilters = (data) => {
    if (!data) return [];

    return data.filter(patient => {
      const ageMatch = (!filters.minAge || patient.age >= parseInt(filters.minAge)) &&
                      (!filters.maxAge || patient.age <= parseInt(filters.maxAge));
      const conditionMatch = !filters.condition || 
                            patient.condition.toLowerCase().includes(filters.condition.toLowerCase());

      return ageMatch && conditionMatch;
    });
  };

  const getChartData = () => {
    if (!results) return [];

    const filteredData = applyFilters(results);
    const conditionCounts = {};

    filteredData.forEach(patient => {
      conditionCounts[patient.condition] = (conditionCounts[patient.condition] || 0) + 1;
    });

    return Object.entries(conditionCounts).map(([condition, count]) => ({
      condition,
      count,
      percentage: ((count / filteredData.length) * 100).toFixed(1)
    }));
  };

  const getPieData = () => {
    const chartData = getChartData();
    return chartData.map((item, index) => ({
      name: item.condition,
      value: item.count,
      color: ['#8884d8', '#82ca9d', '#ffc658', '#ff7300', '#00ff00'][index % 5]
    }));
  };

  const COLORS = ['#8884d8', '#82ca9d', '#ffc658', '#ff7300', '#00ff00'];

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 p-6">
      <div className="max-w-6xl mx-auto">
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-gray-800 mb-2">
            AI on FHIR Query System
          </h1>
          <p className="text-gray-600 text-lg">
            Natural language healthcare data querying with FHIR compliance
          </p>
        </div>

        {/* Search Section */}
        <div className="bg-white rounded-lg shadow-lg p-6 mb-6">
          <div className="flex flex-col space-y-4">
            <div className="relative">
              <Search className="absolute left-3 top-3 h-5 w-5 text-gray-400" />
              <input
                type="text"
                value={query}
                onChange={(e) => setQuery(e.target.value)}
                placeholder="Enter your query (e.g., 'Show me all diabetic patients over 50')"
                className="w-full pl-10 pr-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
              />
            </div>

            <div className="flex flex-wrap gap-2">
              <span className="text-sm text-gray-600 mr-2">Try:</span>
              {querySuggestions.map((suggestion, index) => (
                <button
                  key={index}
                  onClick={() => setQuery(suggestion)}
                  className="px-3 py-1 bg-blue-100 text-blue-700 rounded-full text-sm hover:bg-blue-200 transition-colors"
                >
                  {suggestion}
                </button>
              ))}
            </div>

            <button
              onClick={handleSearch}
              disabled={loading || !query.trim()}
              className="w-full bg-blue-600 text-white py-3 px-6 rounded-lg hover:bg-blue-700 disabled:bg-gray-300 disabled:cursor-not-allowed transition-colors"
            >
              {loading ? 'Processing...' : 'Search FHIR Data'}
            </button>
          </div>
        </div>

        {/* Filters Section */}
        {results && (
          <div className="bg-white rounded-lg shadow-lg p-6 mb-6">
            <h3 className="text-lg font-semibold mb-4 flex items-center">
              <Filter className="h-5 w-5 mr-2" />
              Filters
            </h3>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Min Age
                </label>
                <input
                  type="number"
                  value={filters.minAge}
                  onChange={(e) => setFilters({...filters, minAge: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Max Age
                </label>
                <input
                  type="number"
                  value={filters.maxAge}
                  onChange={(e) => setFilters({...filters, maxAge: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Condition
                </label>
                <input
                  type="text"
                  value={filters.condition}
                  onChange={(e) => setFilters({...filters, condition: e.target.value})}
                  placeholder="e.g., Diabetes"
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                />
              </div>
            </div>
          </div>
        )}

        {/* Results Section */}
        {results && (
          <div className="bg-white rounded-lg shadow-lg p-6">
            <div className="flex justify-between items-center mb-6">
              <h3 className="text-lg font-semibold">
                Query Results ({applyFilters(results).length} patients found)
              </h3>
              <div className="flex space-x-2">
                <button
                  onClick={() => setViewType('table')}
                  className={`px-4 py-2 rounded-lg flex items-center space-x-2 transition-colors ${
                    viewType === 'table' ? 'bg-blue-600 text-white' : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                  }`}
                >
                  <Grid className="h-4 w-4" />
                  <span>Table</span>
                </button>
                <button
                  onClick={() => setViewType('chart')}
                  className={`px-4 py-2 rounded-lg flex items-center space-x-2 transition-colors ${
                    viewType === 'chart' ? 'bg-blue-600 text-white' : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                  }`}
                >
                  <BarChart3 className="h-4 w-4" />
                  <span>Charts</span>
                </button>
              </div>
            </div>

            {viewType === 'table' ? (
              <div className="overflow-x-auto">
                <table className="w-full border-collapse">
                  <thead>
                    <tr className="bg-gray-50">
                      <th className="border border-gray-300 px-4 py-2 text-left">Patient ID</th>
                      <th className="border border-gray-300 px-4 py-2 text-left">Name</th>
                      <th className="border border-gray-300 px-4 py-2 text-left">Age</th>
                      <th className="border border-gray-300 px-4 py-2 text-left">Condition</th>
                      <th className="border border-gray-300 px-4 py-2 text-left">Diagnosis Code</th>
                      <th className="border border-gray-300 px-4 py-2 text-left">Last Visit</th>
                    </tr>
                  </thead>
                  <tbody>
                    {applyFilters(results).map((patient) => (
                      <tr key={patient.id} className="hover:bg-gray-50">
                        <td className="border border-gray-300 px-4 py-2">{patient.id}</td>
                        <td className="border border-gray-300 px-4 py-2 flex items-center">
                          <User className="h-4 w-4 mr-2 text-gray-500" />
                          {patient.name}
                        </td>
                        <td className="border border-gray-300 px-4 py-2">
                          <span className="flex items-center">
                            <Calendar className="h-4 w-4 mr-1 text-gray-500" />
                            {patient.age}
                          </span>
                        </td>
                        <td className="border border-gray-300 px-4 py-2">
                          <span className="flex items-center">
                            <Heart className="h-4 w-4 mr-1 text-red-500" />
                            {patient.condition}
                          </span>
                        </td>
                        <td className="border border-gray-300 px-4 py-2 font-mono text-sm">
                          {patient.diagnosis_code}
                        </td>
                        <td className="border border-gray-300 px-4 py-2">{patient.last_visit}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            ) : (
              <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
                {/* Bar Chart */}
                <div className="bg-gray-50 p-4 rounded-lg">
                  <h4 className="text-md font-semibold mb-4">Condition Distribution</h4>
                  <ResponsiveContainer width="100%" height={300}>
                    <BarChart data={getChartData()}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="condition" />
                      <YAxis />
                      <Tooltip />
                      <Bar dataKey="count" fill="#8884d8" />
                    </BarChart>
                  </ResponsiveContainer>
                </div>

                {/* Pie Chart */}
                <div className="bg-gray-50 p-4 rounded-lg">
                  <h4 className="text-md font-semibold mb-4">Condition Percentages</h4>
                  <ResponsiveContainer width="100%" height={300}>
                    <PieChart>
                      <Pie
                        data={getPieData()}
                        cx="50%"
                        cy="50%"
                        labelLine={false}
                        label={({ name, value }) => `${name}: ${value}`}
                        outerRadius={80}
                        fill="#8884d8"
                        dataKey="value"
                      >
                        {getPieData().map((entry, index) => (
                          <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                        ))}
                      </Pie>
                      <Tooltip />
                    </PieChart>
                  </ResponsiveContainer>
                </div>
              </div>
            )}
          </div>
        )}

        {/* FHIR API Preview */}
        {results && (
          <div className="bg-white rounded-lg shadow-lg p-6 mt-6">
            <h3 className="text-lg font-semibold mb-4">Simulated FHIR API Request</h3>
            <div className="bg-gray-900 text-green-400 p-4 rounded-lg font-mono text-sm">
              <div className="text-blue-400">GET /fhir/Patient</div>
              <div className="text-yellow-400">Query Parameters:</div>
              <div className="ml-4">
                {query.toLowerCase().includes('diabetic') && <div>• condition=diabetes</div>}
                {query.toLowerCase().includes('hypertension') && <div>• condition=hypertension</div>}
                {query.toLowerCase().includes('heart') && <div>• condition=heart-disease</div>}
                {query.match(/over (\d+)/i) && <div>• age=gt{query.match(/over (\d+)/i)[1]}</div>}
                {query.match(/under (\d+)/i) && <div>• age=lt{query.match(/under (\d+)/i)[1]}</div>}
                {query.match(/between (\d+) and (\d+)/i) && (
                  <div>• age=ge{query.match(/between (\d+) and (\d+)/i)[1]}&age=le{query.match(/between (\d+) and (\d+)/i)[2]}</div>
                )}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default FHIRQuerySystem;
